import React from 'react'

class Tuesday extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            expanded: false,
            content: "Tuesday"
        }
    };
    handleHover(){
        const potato =         <ul>
        <li>00:01 - 03:00</li>
        <li>03:01 - 06:00</li>
        <li>06:01 - 09:00</li>
        <li>09:01 - 12:00</li>
        <li>12:01 - 15:00</li>
        <li>15:01 - 18:00</li>
        <li>18:01 - 21:00</li>
        <li>21:01 - 00:00</li>
    </ul>
        this.setState({content: potato}
        )

    }
    render(){
        return(
        <p className = "Weekday" onMouseOver = {this.handleHover}>
            {this.state.content}
        </p>
        )
    }
}

export default Tuesday
